class RenderAccessibility_HitTest_ProxyToResponder : public ::mojo::internal::ProxyToResponder {
public:
    static RenderAccessibility::HitTestCallback CreateCallback(::mojo::Message& message, std::unique_ptr<mojo::MessageReceiverWithStatus> responder)
    {
        std::unique_ptr<RenderAccessibility_HitTest_ProxyToResponder> proxy(new RenderAccessibility_HitTest_ProxyToResponder(message, std::move(responder)));
        return base::BindOnce(&RenderAccessibility_HitTest_ProxyToResponder::Run, std::move(proxy));
    }

    ~RenderAccessibility_HitTest_ProxyToResponder()
    {
#if DCHECK_IS_ON()
        if (responder_) {
            // If we're being destroyed without being run, we want to ensure the
            // binding endpoint has been closed. This checks for that asynchronously.
            // We pass a bound generated callback to handle the response so that any
            // resulting DCHECK stack will have useful interface type information.
            // Instantiate a ScopedFizzleBlockShutdownTasks to allow this request to
            // fizzle if this happens after shutdown and the endpoint is bound to a
            // BLOCK_SHUTDOWN sequence.
            base::ThreadPoolInstance::ScopedFizzleBlockShutdownTasks fizzler;
            responder_->IsConnectedAsync(base::BindOnce(&OnIsConnectedComplete));
        }
#endif
    }

private:
    RenderAccessibility_HitTest_ProxyToResponder(::mojo::Message& message, std::unique_ptr<mojo::MessageReceiverWithStatus> responder)
        : ::mojo::internal::ProxyToResponder(message, std::move(responder))
    {
    }

#if DCHECK_IS_ON()
    static void OnIsConnectedComplete(bool connected)
    {
        DCHECK(!connected) << "RenderAccessibility::HitTestCallback was destroyed without "
                           << "first either being run or its corresponding binding being closed. "
                           << "It is an error to drop response callbacks which still correspond "
                           << "to an open interface pipe.";
    }
#endif

    void Run(HitTestResponsePtr in_hit_test_response);
};

bool RenderAccessibility_HitTest_ForwardToCallback::Accept(mojo::Message* message)
{
    DCHECK(message->is_serialized());
    internal::RenderAccessibility_HitTest_ResponseParams_Data* params
        = reinterpret_cast<internal::RenderAccessibility_HitTest_ResponseParams_Data*>(message->mutable_payload());

    // Validation for RenderAccessibility.2
    bool success = true;
    HitTestResponsePtr p_hit_test_response {};
    RenderAccessibility_HitTest_ResponseParamsDataView input_data_view(params, message);

    if (success && !input_data_view.ReadHitTestResponse(&p_hit_test_response))
        success = false;
    if (!success) {
        ReportValidationErrorForMessage(message, mojo::internal::VALIDATION_ERROR_DESERIALIZATION_FAILED, RenderAccessibility::Name_, 2, true);
        return false;
    }
    if (!callback_.is_null())
        std::move(callback_).Run(std::move(p_hit_test_response));
    return true;
}

